package dsalgo.algos.problemsolving.string;

public class SpecialStringAgain {
    public static void main(String[] args) {
        String s = "";
        int count = 0;

        for (int i = 0; i < s.length(); i++) {
            int j = i + 1;
            while (j <= s.length()) {
                String sub = s.substring(i, j);
                if (sub.length() % 2 == 0) {
                    if (allEqual(sub))
                        count++;
                } else {
                    if (midEqual(sub))
                        count++;
                }
                j++;
            }
        }

        System.out.println(count);
    }

    private static boolean allEqual(String s) {
        int firstChar = s.charAt(0);
        for (int i : s.toCharArray()) {
            if (i != firstChar)
                return false;
        }
        return true;
    }

    private static boolean midEqual(String s) {
        if (s.charAt(0) != s.charAt(s.length() - 1))
            return false;
        int mid = s.length() / 2;
        return s.substring(0, mid).equals(s.substring(mid + 1));
    }

}
